import React from "react";
import os from "../../../Image/os.png";
import "./More.css";

const More = () => {
  return (
    <div className="more">
      <div className="row">
        <div className="col">
          <div className="row m-auto">
            <p className="">More Application</p>
          </div>
          <div className="row">
            <div className="col">
              <img src={os} alt="" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default More;
